import React, {Component} from 'react';
import brandimg from "../../brand/brand/express_bengal_meat.png";
import  './css/shopbycategory.css'

class ShopByCategory extends Component {
    render() {
        return (

            <div className="shopbycategory">


                <div className="shopbycategory-bottom">
                    <div className="item1">
                        <img  src={"http://localhost:2001/"+this.props.product.image} alt=""/>
                        <p className="name">{this.props.product.name.substr(0,15)+".."}</p>
                        <p className="price">{this.props.product.price}</p>

                    </div>
                </div>
            </div>
        );
    }
}

export default ShopByCategory;
